          "id": "a8227e8b3bda5f51d1de8bd39e9d7bba5705a93a",
          "message": "Merge #1941\n\n1941: Refactor proposals r=grumbach a=grumbach\n\n<!--\r\nThanks for contributing to the project! We recommend you check out our \"Guide to contributing\" page if you haven't already: https://github.com/maidsafe/QA/blob/master/CONTRIBUTING.md\r\n\r\nWrite your comment below this line: -->\r\n\r\nRefactor the `NodeMsg::Propose` into 4 distinct messages:\r\n- `NodeMsg::RequestHandover`: when nodes finish DKG and request a handover to the current elders (node->elder)\r\n- `NodeMsg::SectionHandoverPromotion`: when elders tell those nodes that they are promoted as elder (elder->node)\r\n- `NodeMsg::SectionSplitPromotion`: when elders tell those nodes that they are promoted as elder in either side of a split (elder->node)\r\n- `NodeMsg::ProposeSectionState`: when elders decide to kick nodes or accept new nodes within a section (elder->elder)\r\n\r\nThis distinction makes explicit:\r\n- who is signing\r\n- who is receiving/aggregating the signatures\r\n\r\nAll the changes are in the [refactor: proposal into multiple distinct messages](https://github.com/maidsafe/safe_network/pull/1941/commits/692135f6c803926403cf46ba3b2b747660b04d1d) commit.\r\n\r\nThe other commits are tidying up and moving code around: large diffs of nothingness!\n\nCo-authored-by: grumbach <anselmega@gmail.com>",
